import React from 'react';
import Header from './components/Header.js';
import Footer from './components/Footer';
import Login from './pages/Login';
import Home from './pages/Home';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header title="게시판" />
      <Login />
      <Footer content="위지언" />
    </div>
  );
}

export default App;
